export default async function add(something) {
  const url = "https://cubioinfo.com/aptitude-test/api/post/answersheets";

  try {
    const response = await fetch(url, {
      method: "POST",
      headers: {
        Authorization: "sometoken",
      },
      body: JSON.stringify({
        payload: something,
      }),
    });
    console.log("do it");

    return await response.json();
  } catch (error) {
    console.log(error);
  }
}
